import React from 'react';
import { Route, Switch, Link } from 'react-router-dom';
import DefineAxes from './DefineAxes';

function Compass(props) {
    return (
        <figure className={"compass" + (props.animated ? " animated" : "")}>
            <span className="x-axis"></span>
            <label className="x-label">{props.xlab}</label>
            <span className="y-axis"></span>
            <label className="y-label">{props.ylab}</label>
            <span className="point" style={{top: props.yScore + "%", left: props.xScore + "%"}}></span>
        </figure>
    )
}

export default Compass
